import React, { Component } from 'react';
import {Figure} from 'react-bootstrap/';

const profile_pic = require('../img/profile_pic.png');



class LeftSideBar extends Component {
  render() {
    return (
        <Figure>
            <Figure.Image
                width={171}
                height={180}
                alt="171x180"
                src={profile_pic}
                roundedCircle
            />
            <Figure.Caption>
                <p><b></b></p>
                <p>Karachi, PAK</p>
            </Figure.Caption>
      </Figure>
    )
  }
}

export default LeftSideBar;
